import React from 'react'
import './Container.css'
const Container = (props) => {
  return (
    <>

      <div class="row">
        <div class="content m-4">
          <div className='m-4'>
            {props.children}
          </div>
          </div>
          </div>
    </>
  )
}

export default Container
